    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,77.9457,684.6332)"
       style="font-style:italic;font-variant:normal;font-weight:normal;font-stretch:normal;font-size:10px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Italic;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text110"><tspan
         
         y="0"
         id="tspan104">Kærupvej 9, 7741 Frøstrup</tspan><tspan
         
         y="13"
         id="tspan106">Tlf. 97 99 13 55, www.bjerget.dk</tspan><tspan
         
         y="26"
         id="tspan108">E-mail: kontor@bjerget.dk </tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,77.9457,645.6332)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text122"><tspan
         
         y="0"
         id="tspan112">På Bjerget Efterskole tilbyder vi trygge rammer. Her kan livet udfolde sig i et fællesskab, hvor vi har ansvar for hinan-</tspan><tspan
         
         y="12.996"
         id="tspan114">den. Vi lægger vægt på en solid boglig undervisning, men vi laver også andre ting. Vi synger, spiller musik og teater, </tspan><tspan
         
         y="25.992001"
         id="tspan116">har kreative fag, spiller volleyball, badminton m.m. i vores flotte, nye idrætshal. dyrker friluftsliv, sejler havkajak og </tspan><tspan
         
         y="38.987999"
         id="tspan118">klatrer på vores nye klatrevæg. Vi tager på skitur og laver musical. Med åbenhed, tillid og livsglæde i centrum ønsker </tspan><tspan
         
         y="51.984001"
         id="tspan120">vi at skabe en nutidig skole med udgangspunkt i det kristne menneske- og livssyn.</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,77.9457,566.5114)"
       style="font-variant:normal;font-weight:bold;font-stretch:normal;font-size:13px;font-family:'Frutiger 45 Light';-inkscape-font-specification:Frutiger-Bold;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text126"><tspan
         
         y="0"
         id="tspan124">Galtrup Musik- og idrætsefterskole </tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,77.9457,553.5114)"
       style="font-style:italic;font-variant:normal;font-weight:normal;font-stretch:normal;font-size:10px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Italic;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text134"><tspan
         
         y="0"
         id="tspan128">Øster Jølby, 7850 Erslev</tspan><tspan
         
         y="13"
         id="tspan130">Tlf. 97 74 11 06, www.galtrup.dk</tspan><tspan
         
         y="26"
         id="tspan132">E-mail: galtrup@galtrup.dk </tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,77.9457,514.5114)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text150"><tspan
         
         y="0"
         id="tspan136">Galtrup Musik- og idrætsefterskole er en nutidig og moderne skole, der bygger på det grundtvig-koldske skolesyn. </tspan><tspan
         
         y="12.996"
         id="tspan138">Her kan du fordybe og dygtiggøre dig i musik og idræt, samtidig med at du får din FsA eller Fs10-prøve. skolen er </tspan><tspan
         
         y="25.992001"
         id="tspan140">ombygget, renoveret og fremstår med meget fine faciliteter til alle fag. der er trådløst internet og smart Boards i </tspan><tspan
         
         y="38.987999"
         id="tspan142">alle klasser. 4 linjefag: boldspil, slagbold, gymnastik og musik. Mange valgfag: golf, fodbold, håndbold, løb, volley, </tspan><tspan
         
         y="51.984001"
         id="tspan144">badminton, bordtennis, design, filt, rytmisk sammenspil, kor, musikteori, it og medie. Vi har mange anderledes uger </tspan><tspan
         
         y="64.980003"
         id="tspan146">med bl.a. skitur, musical, friluftsture og gymnastik. Galtrup Musik- og idrætsefterskole er røgfri og har 138 elever i 8., </tspan><tspan
         
         y="77.975998"
         id="tspan148">9. og 10. klasse.</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,77.9457,409.3895)"
       style="font-variant:normal;font-weight:bold;font-stretch:normal;font-size:13px;font-family:'Frutiger 45 Light';-inkscape-font-specification:Frutiger-Bold;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"

    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,77.9506,252.2676)"
       style="font-style:italic;font-variant:normal;font-weight:normal;font-stretch:normal;font-size:10px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Italic;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text212"><tspan
         
         y="0"
         id="tspan206">Hedegårdsvej 59, Svankjær, 7755 Bedsted Thy </tspan><tspan
         
         y="13"
         id="tspan208">Tlf. 97 94 82 70, www.svankjaer.dk </tspan><tspan
         
         y="26"
         id="tspan210">E-mail: kontoret@svankjaer.dk </tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,77.9457,213.2676)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text226"><tspan
         
         y="0"
         id="tspan214">Find din ’indre svane’ på svankjær Efterskole. En dialogsøgende skole med kristne værdier og fokus på fællesskabet </tspan><tspan
         
         y="12.996"
         id="tspan216">og den enkeltes behov. ridning, adventure, motor/metal og international linje er vore hovedlinjefag. Mulighed for </tspan><tspan
         
         y="25.992001"
         id="tspan218">at medbringe egen hest. derudover form &amp; fitness, mountainbike, fodbold, springgymnastik, smykkedesign, musik &amp; </tspan><tspan
         
         y="38.987999"
         id="tspan220">drama. skolen underviser i alle prøveforberedende fag. rejser, musical, gymnastikopvisning og fællesaktiviteter med </tspan><tspan
         
         y="51.984001"
         id="tspan222">naboefterskoler giver spændende afbrud i hverdagen. skolen tilbyder undervisning til 8., 9. og 10. klasser. </tspan><tspan
         
         y="64.980003"
         id="tspan224">specialundervisning tilbydes efter aftale. se nærmere på vores hjemmeside www.svankjaer.dk.</tspan></text>

    <text

       id="text106"><tspan
         
         y="0"
         id="tspan104">Rovvig Efterskole</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,66.6071,764.6332)"
       style="font-style:italic;font-variant:normal;font-weight:normal;font-stretch:normal;font-size:10px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Italic;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text114"><tspan
         
         y="0"
         id="tspan108">Vester Jelby, 7950 Erslev</tspan><tspan
         
         y="13"
         id="tspan110">Tlf. 97 74 17 50, www.rovvig.dk</tspan><tspan
         
         y="26"
         id="tspan112">E-mail: kontoret@rovvig.dk </tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,66.6071,725.6332)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text128"><tspan
         
         y="0"
         id="tspan116">rovvig Efterskole ligger midt i den skønne natur på det nordvestlige Mors. Vi har storslåede udsigter, egen strand </tspan><tspan
         
         y="12.996"
         id="tspan118">med badebro og masser af skov og krat. Et år på rovvig Efterskole er et år med masser af udfordring og action. </tspan><tspan
         
         y="25.992001"
         id="tspan120">du bor på 2-3-sengsværelse sammen med kammerater, som også er interesserede i et eller flere af skolens 5 verdens- </tspan><tspan
         
         y="38.987999"
         id="tspan122">hjørner: mad og gastronomi, sang og musik, kreativitet og design, natur og friluftsliv, vandsport og sejlads. skolen </tspan><tspan
         
         y="51.984001"
         id="tspan124">har både surf- og kajakudstyr, som bruges flittigt – også i fritiden ... Vi glæder os til at se dig! rovvig Efterskole – </tspan><tspan
         
         y="64.980003"
         id="tspan126">skolen med 5 verdenshjørner.</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,66.6071,633.5114)"
       style="font-variant:normal;font-weight:bold;font-stretch:normal;font-size:13px;font-family:'Frutiger 45 Light';-inkscape-font-specification:Frutiger-Bold;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text132"><tspan
         
         y="0"
         id="tspan130">Sjørringvold Efterskole</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,66.6102,620.5114)"
       style="font-style:italic;font-variant:normal;font-weight:normal;font-stretch:normal;font-size:10px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Italic;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text140"><tspan
         
         y="0"
         id="tspan134">Sjørring, 7700 Thisted </tspan><tspan
         
         y="13"
         id="tspan136">Tlf. 96 19 11 19 , www.thy-ordblind.dk </tspan><tspan
         
         y="26"
         id="tspan138">E-mail: kontoret@thy-ordblind.dk </tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,66.6071,581.5114)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text152"><tspan
         
         y="0"
         id="tspan142">sjørringvold er en almendannende efterskole for normaltbegavede elever med specifikke læse- og stavevanskelighe-</tspan><tspan
         
         y="12.996"
         id="tspan144">der, hvor vi lægger vægt på computerbaseret hjælp. Vi tager udgangspunkt i eleverne og er derfor prøvefri, men har </tspan><tspan
         
         y="25.992001"
         id="tspan146">håndværksfag på højere niveau og ekstra kompetenceundervisning til teknisk skole. Vi benytter thys nationalpark </tspan><tspan
         
         y="38.987999"
         id="tspan148">med skov, sø, land og strand til friluftsliv, surfing, jagt, fiskeri og rollespil. sammen med gokartkørsel, idræt og musik </tspan><tspan
         
         y="51.984001"
         id="tspan150">og meget andet har vi således en bred vifte af muligheder.</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,66.6071,502.3895)"
       style="font-variant:normal;font-weight:bold;font-stretch:normal;font-size:13px;font-family:'Frutiger 45 Light';-inkscape-font-specification:Frutiger-Bold;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text156"><tspan
         
         y="0"
         id="tspan154">Thyland idrætsefterskole </tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,66.6054,489.3895)"

       id="text164"><tspan
         
         y="0"
         id="tspan158">Vorupørvej 73, 7700 Thisted </tspan><tspan
         
         y="13"
         id="tspan160">Tlf. 97 93 70 50 , www.thyland.dk</tspan><tspan
         
         y="26"
         id="tspan162">E-mail: info@thyland.dk </tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,66.6071,450.3895)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text178"><tspan
         
         y="0"
         id="tspan166">Vi er en røgfri idrætsefterskole for alle unge, der elsker at være aktive. Vi tilbyder et udfordrende skoleår med </tspan><tspan
         
         y="12.996"
         id="tspan168">fællesskab i centrum og linjer i gymnastik, fodbold, håndbold, idræt, medie, nørdværksted, design eller musik samt </tspan><tspan
         
         y="25.992001"
         id="tspan170">god boglig, niveaudelt undervisning. </tspan><tspan
         
         y="38.987999"
         id="tspan172">thyland har gode faglokaler, en boldspilhal og en nybygget idrætshal med springcenter og stort auditorium. Året </tspan><tspan
         
         y="51.984001"
         id="tspan174">rummer skikursus i Østrig, musical, cykeltur, emneuger, aktiviteter, stævner og turneringer planlagt af positive elever </tspan><tspan
         
         y="64.980003"
         id="tspan176">samt et engageret personale. Vi ses til en oplevelse for livet.</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,66.6071,358.2676)"

    <text

    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,66.6071,306.2676)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text200"><tspan
         
         y="0"
         id="tspan192">Blidstrup Efterskole ønsker at være en nutidig, åben og fri skole med et kristent livs- og menneskesyn. Vi tilstræber </tspan><tspan
         
         y="12.996"
         id="tspan194">at være en bred efterskole for alle unge. skolen tilbyder ud over de almindelige skolefag linje- og valgfag i idræt, </tspan><tspan
         
         y="25.992001"
         id="tspan196">friluftsliv, håndværk, musik, design, ridning, medie, motorlære, fitness, jagt, glas, sløjd, gokarts m.m. i løbet af året </tspan><tspan
         
         y="38.987999"
         id="tspan198">vil du også opleve musicaluge, udenlandstur og emnedage. du har mulighed for at have din egen hest med.</tspan></text>
